import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import './App.css';
import './Cadastro.css';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
ReactDOM.render(
  <CadastroForm />,
  document.getElementById('root')
);
